import React, { useEffect } from 'react';
import axios from 'axios';

const Book = () => {
  useEffect(() => {
    const fetchBooks = async () => {
      try {
        const response = await axios.get("http://localhost:5000/api/b1/getBook");
        console.log(response.data);
      } catch (error) {
        console.log(error);
      }
    };

    fetchBooks();
  }, []);

  return (
    <div>
      <div className="bg-dark" style={{ minHeight: "91vh" }}>
        <div className="d-flex justify-context-center align-items-center py-3">
          <h4 className="text-white">Book Section</h4>
        </div>
      </div>
    </div>
  );
};

export default Book;
